            array(
                'taxonomy' => $atts['taxonomy'],
                'field'    => 'slug',
                'terms'    => $atts['term'],
            ),
        );
    }

    $query = new WP_Query( $args );

    if ( $query->have_posts() ) {
        $output = '<ul>';
